import './App.css';
import React from 'react';
import Home from '../src/pages/Home'
import Saved from '../src/pages/Saved'

function App() {
  return (
    <Router>
    <div>
      <Nav />
      <Switch>
        <Route exact path={["/", "/home"]}>
          <Home />
        </Route>
        <Route exact path="/submit">
          <Saved />
        </Route>
      </Switch>
    </div>
  </Router>
  );
}

export default App;
